package biomass.simulator.gui.model;

public class SimulationPopulation {
	private int simid;
    private int popid;
    
	public SimulationPopulation() {
		// TODO Auto-generated constructor stub
	}

	/**
	 * @return the simid
	 */
	public int getSimid() {
		return simid;
	}

	/**
	 * @param simid the simid to set
	 */
	public void setSimid(int simid) {
		this.simid = simid;
	}

	/**
	 * @return the popid
	 */
	public int getPopid() {
		return popid;
	}

	/**
	 * @param popid the popid to set
	 */
	public void setPopid(int popid) {
		this.popid = popid;
	}
	
	

}
